import React from "react";
import Body from "./Body";

export default function New(){
    const [input, setInput] = React.useState("hey")
    const holla = "hello"
    console.log(input)

    function update(event){
        setInput(event.target.value)
    }
    <Body value = {input}/>

    return (
        <div>
            <input 
                type='text'
                value={input}
                placeholder='Add an item'
                name="input"
                onChange={update}
            />
            <span>+</span>
            <div>{input}</div>
        </div>
    )
}
